import React from "react";
import "./styles/main.css";

function CommentList(props) {
  const comments = props.comments.map(function(user) {
    return (
      <Comment
        Avatar={user.Avatar}
        Name={user.Name}
        Date={user.Date}
        Comment={user.Comment}
      />
    );
  });

  return <div>{comments}</div>;
}

function Comment(props) {
  return (
    <div>
      <img className="users--img" src="" />
      <div className="users">
        {props.Name} {props.Date} {props.Avatar}
      </div>
    </div>
  );
}

export default CommentList;
